  false,\n\t\"url\": null,\n\t\"notes\": \"Using a LH Systems ALS50 Light Detection
  And Ranging (LiDAR) system, flight lines of standard density (1.4 meter ground sample
  distance) data were collected over areas in Brazoria County, TX (approximately 1428
  square miles). Multiple returns were recorded for each laser pulse along with an
  intensity value for each return. The data acquisition occurred in 6 missions between
  April 9, 2006, April 16, 2006, April 17, 2006, and May 11, 2006 through May 13,
  2006. The data was collected by Sanborn Mapping Company, Inc. for the Texas Water
  Development Board (TWDB) and the Federal Emergency Management Agency (FEMA).\",\n\t\"owner_org\":
